class Words {
    func tests() {
        let englishArray = english.split(separator: " ")
        let russianArray = russian.split(separator: " ")
        
        for s in englishArray {
            print(s)
        }
        
        print("/n---------------------------------------------------------------------------")
        print("---------------------------------------------------------------------------")
        print("---------------------------------------------------------------------------")
        print("---------------------------------------------------------------------------/n")
        
        for s in russianArray {
            print(s)
        }
        
    }
}

